import {  useSelector } from 'react-redux';

function Card() {

// const posts = useSelector((state)=>state.posts);
// console.log("Hello",posts);

const [data, setData] = useState([]);

  useEffect(() => {
    fetch('/data')
      .then(response => response.json())
      .then(data => setData(data))
      .catch(error => console.error('Fetch error:', error));
  }, []);


  return (

    <div class="mx-auto">
    <div class="card " style={{width: '18rem',margin:'7rem'}}>

    <img class="card-img-top" src="https://i.pinimg.com/236x/d6/06/4b/d6064bb81e38d01330697a134c9e0b99.jpg" alt="Card cap" style={{height:'260px'}}/>
    <div class="card-body">
      <h5 class="card-title">Rakesh </h5>< h6 class="card-title">Chahal</h6>
      <p class="card-text">rakeshchahal3233@gmail.com</p>
      <p class="card-text">Message from the system</p>
    </div>

    {data.map(post =>{
    <div key={post.id}>{post.fname}</div>
   })}


  </div>
  </div>
  )
}

export default Card;
